function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <body>
        <div className="Container">
          <div className="Top">
            <h1 className="T1">
              <Row><Col span={24}>Le Top</Col></Row>
            </h1>
            <h1 className="T2">
              <Divider>Test</Divider>  
              <Row>
                <Col span={12} style={{backgroundColor: 'green', color: 'white'}}>Columna</Col>
                <Col span={12} style={{backgroundColor: 'green', color: 'white'}}>Columna</Col>
              </Row>  

            </h1>

          </div>
        </div>

      </body>
    </div>
  );
}

export default App;
